import { useState, useEffect } from "react";

function FetchData(url){
    const [data, setData] = useState(null);

    useEffect(() => {
        fetch(url)
        .then(r => r.json())
        .then(d => setData(d));
    }, []);

    return data;
}

export default FetchData;
